import { useRef, useEffect } from "react";
import { register } from "swiper/element/bundle";

register();

export const FaqCarrousel = () => {
  const swiperElRef = useRef(null);

  useEffect(() => {
    swiperElRef.current.addEventListener("swiperprogress", (e) => {
      const [swiper, progress] = e.detail;
      console.log(progress);
    });

    swiperElRef.current.addEventListener("swiperslidechange", () => {
      console.log("slide changed");
    });
  }, []);

  return (
<swiper-container
  ref={swiperElRef}
  slides-per-view="3"
  space-between="30"
  centered-slides="true"
  initial-slide="1"
  autoplay="true"
  grab-cursor="true"

>
      <swiper-slide>
        <div className="slide-text-container">
        <p className="slide-text1">¿Este programa es solo para personas con diabetes tipo 1?</p><br/>
        <p className="slide-text2">No. Está diseñado para personas con diabetes tipo 1,<br/>
        tipo 2 y prediabetes, con análisis de cada paciente<br/>
        y planes personalizados según cada caso.</p>
        </div>
      </swiper-slide>

      <swiper-slide>
        <div className="slide-text-container">
        <p className="slide-text1">¿Necesito tener experiencia previa en entrenamiento y/o alimentación saludable?</p><br/>
        <p className="slide-text2">No. El programa está pensado para acompañarte desde cero, con el apoyo de un equipo profesional que adapta cada plan y módulos a tu nivel.</p><br/>
        </div>
      </swiper-slide>
    
      <swiper-slide>
        <div className="slide-text-container">
          <p className="slide-text1">¿Incluye seguimiento personalizado?</p><br/>
          <p className="slide-text2">Sí. Vas a contar con el acompañamiento de un nutricionista, un coach fitness y  de Lucas durante todo el proceso, además de obtener herramientas prácticas, material pregrabado y más.</p><br/>
        </div>
      </swiper-slide>

      <swiper-slide>
        <div className="slide-text-container">
          <p className="slide-text1">¿Cómo empiezo?</p><br />
          <p className="slide-text2">Podés agendar una llamada directamente en el calendario que encontrarás en la página. En esa llamada estaremos evaluando tu situación actual junto al equipo de profesionales, definiendo si podemos ayudarte y así, comenzar a trabajar juntos.</p><br />
        </div>
      </swiper-slide>

      <swiper-slide>
        <div classNames="slide-text-container">
          <p className="slide-text1">¿Cuánto dura el programa?</p><br />
          <p className="slide-text2">Tiene una duración total de 6 meses, con acceso a materiales, clases pregrabadas, desafíos prácticos, seguimiento personalizado y acceso a plataformas.</p><br />
        </div>
      </swiper-slide>

      <swiper-slide>
        <div className="slide-text-container">
          <p className="slide-text1">¿Qué resultados puedo esperar?</p><br />
          <p className="slide-text2">Cada proceso es único, pero los objetivos principales son: Reducir la HbA1c, estabilizar tu glucosa , disminuir (o incluso revertir) el uso de medicación dependiendo el caso, y sobre todo, mejorar tu calidad de vida.</p><br />
        </div>
      </swiper-slide>

      <swiper-slide>
        <div className="slide-text-container">
          <p className="slide-text1">¿Puedo acceder desde cualquier lugar del mundo?</p>
        </div>
      </swiper-slide>
      
    </swiper-container>
  );
};


export default FaqCarrousel;
